import React from 'react';
import { Text, StyleSheet } from 'react-native';
import { SafeAreaProvider } from 'react-native-safe-area-context';
import { StatusBar } from 'expo-status-bar';
import { Provider as PaperProvider, Button } from 'react-native-paper';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { theme } from './src/styles/theme';

// Простые экраны
const HomeScreen = ({ navigation }) => (
  <SafeAreaProvider style={styles.screen}>
    <Text style={styles.heading}>Главный экран</Text>
    <Button mode="contained" onPress={() => navigation.navigate('Details')}>
      Перейти к деталям
    </Button>
  </SafeAreaProvider>
);

const DetailsScreen = ({ navigation }) => (
  <SafeAreaProvider style={styles.screen}>
    <Text style={styles.heading}>Экран деталей</Text>
    <Button mode="contained" onPress={() => navigation.goBack()}>
      Назад
    </Button>
  </SafeAreaProvider>
);

const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <SafeAreaProvider>
      <PaperProvider theme={theme}>
        <NavigationContainer>
          <Stack.Navigator>
            <Stack.Screen name="Home" component={HomeScreen} options={{ title: 'Главная' }} />
            <Stack.Screen name="Details" component={DetailsScreen} options={{ title: 'Детали' }} />
          </Stack.Navigator>
          <StatusBar style="auto" />
        </NavigationContainer>
      </PaperProvider>
    </SafeAreaProvider>
  );
}

const styles = StyleSheet.create({
  screen: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  heading: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
});
